import React, { Component } from 'react';
import Ski_area_table from '../template/Ski_area_table';


class Skiarea_list extends Component {
  render() {
    return (
      <div className='skiarea_list'>
        <Ski_area_table />
        {this.props.area}
        {this.props.pref}
        <ul>
          {this.props.posts.map(post => (
            <li>
              <h2>{post.id}</h2>
              <p>{post.name}</p>
              <p>{post.pref}</p>
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default Skiarea_list;
